import './style.css';
class Email extends React.Component {
	render(){
		return(
			<div>
			<form>
            <label for="email">Email:</label>
            <input type="email" id="email"/>

            <input type="button" onClick="CheckEmail()" id ="submit" value="Submit" />
            <p id= "message"></p>
        </form>
        </div>
			)
	}
}
